import HomePage from "./home/HomePage";
import LoginPage from './Login/LoginPage';
import Logout from './Logout/logout';
import ChangePassword from "./changePassword/changePasswordComponent";

const routePrefix = "/authentication";

export const routes = [{ path: routePrefix+"/", component: HomePage },
    { path: routePrefix+"/login/:orgId/:loggedOut?/:returnUrl?", component: LoginPage },
    { path: routePrefix+"/logout", component: Logout },
    { path: routePrefix + "/changepassword", component: ChangePassword}
];

export default routes;
